import * as React from 'react';
import { CssBaseline, Link, Avatar, TextField, Typography, Paper, Box, Grid, Button, Checkbox, FormControlLabel, Container } from '@material-ui/core';


import PhoneLocked from '@material-ui/icons/ScreenLockLandscape';
import useStyles from './styles';


const Auth = () => {
    const classes = useStyles();

    return (
        <Container>
            <paper   >

                <Box className={classes.avatar}><Avatar><PhoneLocked /></Avatar> Sign In </Box>
                <form >
                    <Box className={classes.form} >    <TextField

                        name="email"
                        required
                        id="email"
                        label="Email"
                        variant="filled"
                        onChange=''
                    />
                        <TextField

                            name="password"
                            required
                            id="password"
                            label="Password"
                            variant="filled"
                            type="password"
                            onChange=''
                        />

                    </Box>
                    <Button variant="contained" color="secondary" size="large" type="submit"  > Log In</Button>
                </form>
            </paper>


        </Container>

    );
}
export default Auth;
